समाजसेवी तथा राजनीतिज्ञ, निडर व्यक्तित्वका धनि श्री बैजु प्रसाद गुप्ता &nbsp;( दिपक ) को जन्म पिता वंशराज गुप्ता र माता धनावती गुप्ताको कोख बाट बि. स. २०४० साल कार्तिक २६ गते नवलपरासी जिल्लाको साबिक कुश्मा गा.बि. स. वार्ड नम्बर १ बेलाशपुरमा भएको थियो ӏ



&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; सानै देखि चन्चले स्वभावको उहा कुनै पनी काम सोचे पछी गरेरै छोड्ने गर्नु हुन्थ्यो ӏ अत्यन्तै मिहिनेती र उदार स्वभावका गुप्ता समाजमा पनि सानै देखि प्रतिस्ठित हुनुहुन्थ्यो ӏ नितानान्द मा. बी. जहदा बाट माध्यामिक सम्मको शिक्षा हासिल गर्नु भएको उहा बि. स. २०५५ देखि माओबादी केन्द्रको तर्फबाट गुप्तचर हुदै भूमिगत राजनितीमा प्रवेश गर्नु भएको थियो ӏ भुमिगत राजनिती गर्ने क्रममा पटक पटक नेपाल लगायत भारतका विभिन्न जेलमा जेलजीवन बिताउनु भएको थियो ӏ

&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;नेपालको पिपरहवा चौकी, परासी, भैरहवा, पाल्पा लगायत का जेलमा रहदा सरकार पक्षबाट चरम यातना प्रदान गर्दा पनि आफ्नो लक्ष्य र सिद्दान्त बाट कत्तिपनि बिचलित नभई गरिब , निमुखा, दलिक, उत्पीडित, जनजाति, मधेसीहरुको हकहितको लागि निरन्तर रुपमा माओबादी केन्द्रमा रहेर संघर्षरत रहनु भयो ӏ

&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; संकटकालको समयमा पनि जनमुक्ति सेनाको लागि आवश्यक चाजोपाजो मिलाउनको लागि गुप्तचर को&nbsp; नेतृत्व गर्दै आफ्नो कुशलता देखाउनु भएको थियो ӏ&nbsp;

&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; युवाहरु माझ अत्यन्तै लोकप्रिय गुप्ता बि. स. २०६२ मा YCL नेपाल, नवलपरासीको&nbsp; जिल्ला कोषाध्यक्ष पदमा निर्बाचित भै २०६६ सम्म कुशलता पुर्वक &nbsp;आफ्नो कार्यभार सम्हाल्नु भयो ӏ

तेस्तै बि.स. २०६६ देखि २०६९ सम्म नवलपरासी जिल्लाको जिल्ला उपाध्यक्ष&nbsp; , बि.स. २०६९ देखि २०७४ सम्म YCL नवलपरासीको जिल्ला सह- इन्चार्ज तथा YCL केन्द्रीय सदस्य&nbsp; र बि.स. २०७२ देखि माओबादी केन्द्र को&nbsp; केन्द्रीय सदस्य भै कार्य गर्नु भएको छ ӏ

&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; स्थानीय क्षेत्रमा आफ्नो व्यक्तित्वबाट &nbsp;अत्यन्तै लोकप्रिय नेता गुप्ता बि.स. २०७४ को असार १४ गते सम्पन्न भएको दोश्रो चरणको&nbsp; स्थानीय चुनाव बाट पाल्हिनन्दन गाउपालिका प्रमुखमा भारी मतान्तरले निर्बाचित हुनुभयो ӏ

